import React from "react";

export default function Game(props) {
  const { join_id, players } = props;
  return (
    <div>
      <div>ID: {join_id}</div>
      <div>Players</div>
      <ol>
        {players.map(({ id, name, score }) => (
          <li key={id}>
            <div>{name}</div>
            <div>{score[14]}</div>
            <div>{score[15]}</div>
            <div>{score[16]}</div>
            <div>{score[17]}</div>
            <div>{score[18]}</div>
            <div>{score[19]}</div>
            <div>{score[20]}</div>
            <div>{score["bull"]}</div>
          </li>
        ))}
      </ol>
    </div>
  );
}
